import React from "react";
import {
Box,
Container,
Row,
Column,
FooterLink,
Heading,
} from "./FooterStyles";
import "./Icons.css";

const Footer = () => {
return (
	<Box>
	<Container>
		<Row>
		<Column>
			<Heading>Social Media</Heading>
			<a href="#" className="fa fa-facebook">
			</a>
			<a href="#" className="fa fa-twitter">
			</a>
			<a href="#" className="fa fa-instagram">
			</a>
		</Column>
		</Row>
	</Container>
	</Box>
);
};
export default Footer;
